import React from 'react';
import { GluestackUIProvider, Box, VStack, View } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';
import { NavigationContainer } from '@react-navigation/native';
import { useNavigation } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createDrawerNavigator } from '@react-navigation/drawer';

function HomeScreen() {
  const navigation = useNavigation();
  return <View style={{
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'
  }}></View>}
const Drawer = createDrawerNavigator();
const Tab = createBottomTabNavigator();
export default function App() {
  return <NavigationContainer>
  <GluestackUIProvider config={config}>
  <VStack space="md" reversed={false} backgroundColor='#DADADA' alignItems='center'>

  <Box w={500} h={500} bg="#0C0C0C" marginTop={15} borderWidth={'$1'} borderColor='cyan' marginBottom={200} >


  </Box>

  </VStack>

</GluestackUIProvider>
</NavigationContainer>;
